  \"2016-02-02T16:16:24.917774\",\n\t\"name\": \"long-tailed-duck-clangula-hyemalis-microsatellite-dna-data-alaska-canada-russia-1994-2002\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set describes nuclear microsatellite
  genotypes derived from twelve autosomal loci (6AB, Aph02, Aph08, Aph19, Aph23, Bca10,
  Bca11, Hhi5, Sfi11, Smo07, Smo09, and CRG), and two Z-linked microsatellite loci
  (Bca4 and Smo1). A total of 111 Long-tailed Ducks were examined for this genotyping
  with samples coming from the two primary breeding locales within Alaska (Arctic
  Coastal Plain of Alaska and the Yukon Delta, Western Alaska) and a representative
  locale in the central Canadian Arctic (Queen Maud Gulf Bird Sanctuary, Nunavut,
  Canada). The sex of most samples was determined in the field by plumage and later
  confirmed by using the CHD molecular sexing protocol (Griffiths et al., 1998).\",\n\t\"license_title\":
